 @gustavomarques4097  Não era a questão de entregar. O Grêmio na sua condição, não tinha que entregar nada. Mas os elementos ao redor que são considerados. 
Pra refrescar sua memória de caranguejo: 
1- A torcida do Grêmio, se esforçou ao ponto de fazer uma música especial só para o rebaixamento do Corinthians, sendo que não tinha rivalidade forte entre os dois, mas mesmo assim fizeram, só pra serem c*zões;
2 - o Jonas saiu comemorando tanto o gol, que parecia ter feito gol em final de libertadores, tirando a camisa e correndo por todo Olímpico, parecia que nunca tinha feito um gol na vida. 
É por causa desses dois fatores que vamos tampar o caixão e empurrar vocês para a terceira queda de divisão. Principalmente por causa da torcida de c*zão de vocês. 
Prepara que dia 05/12 a Neo Química Arena, que tem uma acústica diferente e infernal, vai ecoar muito a adaptação que eu comentei acima.
